func TestConvertEpochToTime(t *testing.T) {
	type testCase struct {
		name         string
		inputEpoch   *int64
		expectedTime *time.Time
	}

	tcs := []testCase{
		{"convert epoch correctly", GetInt64Ptr(1590980017000),
			GetTimePtr(time.Date(2020, 6, 1, 2, 53, 37, 0, time.UTC))},
		{"handle nil correctly", nil, nil},
		{"convert zero value correctly", GetInt64Ptr(0),
			GetTimePtr(time.Date(1970, 1, 1, 0, 0, 0, 0, time.UTC))},
		{"convert minus value correctly", GetInt64Ptr(-1), nil},
	}

	for _, tc := range tcs {
		t.Run(tc.name, func(t *testing.T) {
			actual := ConvertEpochToTime(tc.inputEpoch)
			assert.Equal(t, tc.expectedTime, actual)
		})
	}
}
